const TaskLine = (props:{
    title?:string,
    description?:string,
    echeance?:string,
    status?:string
}) =>
{
    return (
        <tr>
            <th scope="row">{props.title}</th>
            <td>{props.description}</td>
            <td>{props.echeance}</td>
            <td>{props.status}</td>
        </tr>)
}

export default TaskLine
